import { Form } from "react-bootstrap";

function SearchBar() {
  return (
    <Form>
      <Form.Group>
          <Form.Control type="text" placeholder="Ache o seu produto" />
      </Form.Group>
    </Form>
  );
}

export default SearchBar;
